import './index.css';
import React from "react";
import { FaTimes } from 'react-icons/fa';
import { FaCheck } from 'react-icons/fa';


function TodoIcon({ type }) {

   const iconTypes = {
      "delete": <FaTimes />,
      "check": <FaCheck />
   }

   return (
      <span className={`Icon Icon-svg Icon-${type}`}>
         iconTypes[type]
      </span>
   );
}

export { TodoIcon }
